-- ----------------------------
-- Table structure for tools_gen_table_column
-- ----------------------------
DROP TABLE IF EXISTS `tools_gen_table_column`;
CREATE TABLE `tools_gen_table_column` (
  `column_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `table_id` bigint(20) DEFAULT NULL COMMENT '归属表编号',
  `column_name` varchar(200) DEFAULT NULL COMMENT '列名称',
  `column_comment` varchar(500) DEFAULT NULL COMMENT '列描述',
  `column_type` varchar(100) DEFAULT NULL COMMENT '列类型',
  `go_type` varchar(500) DEFAULT NULL COMMENT 'Go类型',
  `ts_type` varchar(255) DEFAULT NULL COMMENT 'TS类型',
  `go_field` varchar(200) DEFAULT NULL COMMENT 'Go字段名',
  `html_field` varchar(200) DEFAULT NULL COMMENT 'html字段名',
  `is_pk` bit(1) DEFAULT b'0' COMMENT '是否主键（1是）',
  `is_increment` bit(1) DEFAULT b'0' COMMENT '是否自增（1是）',
  `is_required` bit(1) DEFAULT b'0' COMMENT '是否必填（1是）',
  `is_insert` bit(1) DEFAULT b'0' COMMENT '是否为插入字段（1是）',
  `is_edit` bit(1) DEFAULT b'0' COMMENT '是否编辑字段（1是）',
  `is_list` bit(1) DEFAULT b'1' COMMENT '是否列表字段（1是）',
  `is_detail` bit(1) DEFAULT b'1' COMMENT '是否详情字段',
  `is_query` bit(1) DEFAULT b'0' COMMENT '是否查询字段（1是）',
  `sort_order_edit` int(11) DEFAULT '999' COMMENT '插入编辑显示顺序',
  `sort_order_list` int(11) DEFAULT '999' COMMENT '列表显示顺序',
  `sort_order_detail` int(11) DEFAULT '999' COMMENT '详情显示顺序',
  `sort_order_query` int(11) DEFAULT '999' COMMENT '查询显示顺序',
  `query_type` varchar(200) DEFAULT 'EQ' COMMENT '查询方式（等于、不等于、大于、小于、范围）',
  `html_type` varchar(200) DEFAULT NULL COMMENT '显示类型（文本框、文本域、下拉框、复选框、单选框、日期控件）',
  `dict_type` varchar(200) DEFAULT '' COMMENT '字典类型',
  `link_table_name` varchar(50) DEFAULT NULL COMMENT '关联表名',
  `link_table_class` varchar(50) DEFAULT NULL COMMENT '关联表类名',
  `link_table_module_name` varchar(50) DEFAULT NULL COMMENT '关联表模块名',
  `link_table_business_name` varchar(50) DEFAULT NULL COMMENT '关联表业务名',
  `link_table_package` varchar(150) DEFAULT NULL COMMENT '关联表包名',
  `link_label_id` varchar(50) DEFAULT NULL COMMENT '关联表键名',
  `link_label_name` varchar(50) DEFAULT NULL COMMENT '关联表字段值',
  `col_span` int(11) DEFAULT '12' COMMENT '详情页占列数',
  `row_span` int(11) DEFAULT '1' COMMENT '详情页占行数',
  `is_row_start` bit(1) DEFAULT b'0' COMMENT '详情页为行首',
  `min_width` int(11) DEFAULT '100' COMMENT '表格最小宽度',
  `is_fixed` bit(1) DEFAULT b'0' COMMENT '是否表格列左固定',
  `is_overflow_tooltip` bit(1) DEFAULT b'0' COMMENT '是否过长自动隐藏',
  `is_cascade` bit(1) DEFAULT b'0' COMMENT '是否级联查询',
  `parent_column_name` varchar(50) DEFAULT NULL COMMENT '上级字段名',
  `cascade_column_name` varchar(50) DEFAULT NULL COMMENT '级联查询字段',
  PRIMARY KEY (`column_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1206 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='代码生成业务表字段';

